/*eslint-disable*/

import { useEffect } from "react";
import { Chart } from "react-google-charts";

function ShowChart(props) {
  const data = [
    [
      "Element",
      "Density",
      { role: "style" },
      {
        sourceColumn: 0,
        role: "annotation",
        type: "string",
        calc: "stringify",
      },
    ],
    ["Copper", 8.94, "#b87333", null],
    ["Silver", 10.49, "silver", null],
    ["Gold", 19.3, "gold", null],
    ["Platinum", 21.45, "color: #e5e4e2", null],
  ];

  const options = {
    title: "Hello",
    width: 600,
    height: 400,
    bar: { groupWidth: "95%" },
    legend: { position: "none" },
  };
  const chart = (
    <Chart
      chartType="BarChart"
      width="100%"
      height="400px"
      data={data}
      options={options}
    />
  );

  //차트 만들기
  useEffect(() => {});

  return (
    <>
      <h1>{props.result}</h1>
      {chart}
    </>
  );
}

export default ShowChart;
